q=s.p8("Getting Started",A.b([s.e3("How do I log in to the application?",'To log in:\n\n1. Open the VisionVolcan Site Management App\n2. Enter your assigned username and password\n3. Tap the "Login" button\n4. You will be redirected to the main dashboard\n\nIf you encounter login issues, please contact your administrator or email info@volcanvision.com'),s.e3("What are the system requirements?","The app requires:\n\n\u2022 Android 6.0+ or iOS 12.0+\n\u2022 Minimum 2GB RAM\n\u2022 Stable internet connection\n\u2022 50MB free storage space\n\u2022 Supabase authentication access"),s.e3("How do I reset my password?","For password reset:\n\n1. Contact your system administrator\n2. Or email support at info@volcanvision.com\n3. Provide your user ID and registered email\n4. Follow the instructions sent to your email")],r))
p=s.p8("Site Management",A.b([s.e3("How do I create a new construction site?",'To create a new site:\n\n1. Tap the "+" button in the bottom right corner\n2. Fill in the required details:\n   - Site Name\n   - Location\n   - Plot Size (optional)\n   - Number of Floors (optional)\n   - Start Date\n   - Estimated Completion Date\n3. Tap "Add" to create the site\n4. The site will appear in your ongoing sites list'),s.e3("How do I mark a site as completed?",'To mark a site as completed:\n\n1. Find the site in your ongoing sites list\n2. Long-press on the site card\n3. Select "Mark as Completed" from the menu\n4. Confirm your choice\n5. The site will move to the completed section'),s.e3("Can I edit site details after creation?","Currently, direct editing of site details is not available. For modifications:\n\n1. Delete the existing site\n2. Create a new site with updated details\n3. Contact support for bulk updates"),s.e3("How do I delete a site?",'To delete a site:\n\n1. Long-press on the site card\n2. Select "Delete Site" from the menu\n3. Confirm the deletion\n\n\u26a0\ufe0f Warning: This action is permanent and cannot be undone')],r))
o=s.p8("Inventory Management",A.b([s.e3("How do I track inventory for a site?",'To manage inventory:\n\n1. Select the desired site from the dashboard\n2. Navigate to the "Inventory" tab\n3. View all current inventory items with quantities\n4. Tap "Add Item" to add new inventory\n5. Update quantities by tapping existing items'),s.e3("What inventory fields are available?","Inventory items include:\n\n\u2022 Item Name\n\u2022 Description\n\u2022 Current Quantity\n\u2022 Unit (e.g., pieces, kg, bags)\n\u2022 Last Updated Date\n\u2022 Notes/Remarks"),s.e3("How do I update inventory quantities?","To update quantities:\n\n1. Go to the Inventory tab\n2. Tap on the item you want to update\n3. Edit the quantity field\n4. Add notes if needed\n5. Save the changes")],r))
n=s.p8("Expense Tracking",A.b([s.e3("How do I add expenses for a site?",'To add expenses:\n\n1. Select the site from dashboard\n2. Go to "Expenses" tab\n3. Choose expense type:\n   - "Add Material" for raw materials\n   - "Add Contractor" for labor costs\n4. Fill in details:\n   - Item/Contractor Name\n   - Quantity/Units\n   - Rate per unit\n   - Total amount\n   - Date\n5. Save the expense'),s.e3("What types of expenses can I track?","The app tracks:\n\n\u2022 Raw Materials (cement, steel, bricks, etc.)\n\u2022 Contractor Payments\n\u2022 Labor Costs\n\u2022 Equipment Rentals\n\u2022 Miscellaneous expenses\n\u2022 Date-wise expense breakdown"),s.e3("How do I view expense reports?",'To view expenses:\n\n1. Select the site\n2. Go to "Expenses" tab\n3. View all expenses organized by date\n4. See total expense amount at the top\n5. Filter by date range if needed'),s.e3("Can I edit or delete expenses?","Currently, expenses cannot be edited after creation. For corrections:\n\n1. Contact support for bulk corrections\n2. Or add a new corrective entry\n3. Future updates will include edit functionality")],r))
m=s.p8("Dashboard & Navigation",A.b([s.e3("What does the main dashboard show?","The dashboard displays:\n\n\u2022 Toggle between Ongoing and Completed sites\n\u2022 Search functionality for sites\n\u2022 Site cards with:\n   - Site name\n   - Location\n   - Status indicator\n   - Quick access to site details"),s.e3("How does the search functionality work?","Search features:\n\n\u2022 Search by site name\n\u2022 Search by location\n\u2022 Real-time filtering as you type\n\u2022 Works for both ongoing and completed sites"),s.e3("What do the different colors and icons mean?","Visual indicators:\n\n\u2022 Blue icon with construction symbol: Ongoing site\n\u2022 Green icon with checkmark: Completed site\n\u2022 Blue app bar: Primary navigation\n\u2022 Red text: Delete actions\n\u2022 Green text: Confirm/completion actions")],r))
l=s.p8("Technical Support",A.b([s.e3("What should I do if the app is not updating?","Troubleshooting steps:\n\n1. Pull down to refresh the screen\n2. Check your internet connection\n3. Close and reopen the app\n4. Log out and log back in\n5. Clear app cache if needed\n6. Contact support if issues persist"),s.e3("How do I report bugs or issues?","To report issues:\n\n1. Email: info@volcanvision.com\n2. Include:\n   - Description of the issue\n   - Steps to reproduce\n   - Screenshots if possible\n   - Your device information\n   - App version"),s.e3("Is my data backed up automatically?","Data backup information:\n\n\u2022 All data is stored on Supabase cloud servers\n\u2022 Automatic real-time synchronization\n\u2022 Data is backed up regularly\n\u2022 No data loss when switching devices\n\u2022 Export options available on request"),s.e3("How secure is my data?","Security features:\n\n\u2022 Encrypted data transmission\n\u2022 Secure authentication via Supabase\n\u2022 Role-based access control\n\u2022 Regular security audits\n\u2022 Compliance with data protection standards")],r))
s=s.p8("Account & Settings",A.b([s.e3("How do I access account settings?",'Account settings:\n\n1. Tap the menu icon (\u22ee) in the app bar\n2. Select "Account Settings"\n3. Currently in development - coming soon!\n4. Future features include profile management and preferences'),s.e3("How do I log out securely?",'To log out:\n\n1. Tap the menu icon (\u22ee)\n2. Select "Logout"\n3. Confirm the logout action\n4. You will be redirected to the login screen\n5. All local data is cleared for security'),s.e3("Can I use the app on multiple devices?","Multi-device usage:\n\n\u2022 Yes, you can use the app on multiple devices\n\u2022 Data syncs automatically across devices\n\u2022 Use the same login credentials\n\u2022 Changes reflect in real-time")],r))
